contracts/Auction.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract Auction {
    mapping(address => AggregatorV3Interface) public priceFeeds;
    AggregatorV3Interface public ethUsdPriceFeed;

    struct AuctionItem {
        uint256 auctionId;
        address seller;
        IERC721 nftContract;
        uint256 tokenId;
        uint256 startPrice;
        uint256 endTimestamp;
        uint256 highestBid;
        address highestBidder;
        uint8 highestBidCurrency; // 0 for ETH, 1 for ERC20
        address erc20TokenAddress; // Address of the ERC20 token if highestBidCurrency is 1
        uint256 highestBidInUsd;
        bool ended;
    }

    mapping(uint256 => AuctionItem) public auctions;
    uint256 private _auctionIdCounter;

    event AuctionCreated(uint256 indexed auctionId, address indexed seller, address indexed nftContract, uint256 tokenId, uint256 startPrice, uint256 endTimestamp);
    event BidPlaced(uint256 indexed auctionId, address indexed bidder, uint256 amount);
    event AuctionEnded(uint256 indexed auctionId, address indexed winner, uint256 highestBid);

    function initialize() internal virtual {
        _auctionIdCounter = 0;
    }

    function setPriceFeed(address _tokenAddress, address _priceFeedAddress) public virtual {
        priceFeeds[_tokenAddress] = AggregatorV3Interface(_priceFeedAddress);
    }

    function setEthUsdPriceFeed(address _priceFeedAddress) public virtual {
        ethUsdPriceFeed = AggregatorV3Interface(_priceFeedAddress);
    }

    function getLatestPrice(address _tokenAddress) public view virtual returns (int256) {
        AggregatorV3Interface priceFeed = priceFeeds[_tokenAddress];
        (, int256 price, , ,) = priceFeed.latestRoundData();
        return price;
    }

    function createAuction(
        IERC721 _nftContract,
        uint256 _tokenId,
        uint256 _startPrice,
        uint8 _startPriceCurrency, // 0 for ETH, 1 for ERC20
        address _erc20TokenAddress, // Address of the ERC20 token if _startPriceCurrency is 1
        uint256 _duration // in seconds
    ) public virtual {
        require(_startPrice > 0, "Start price must be greater than 0");
        require(_duration > 0, "Duration must be greater than 0");
        if (_startPriceCurrency == 1) {
            require(_erc20TokenAddress != address(0), "ERC20 token address cannot be zero");
        }

        // Transfer NFT to the auction contract
        _nftContract.transferFrom(msg.sender, address(this), _tokenId);

        _auctionIdCounter++;
        uint256 newAuctionId = _auctionIdCounter;

        auctions[newAuctionId] = AuctionItem({
            auctionId: newAuctionId,
            seller: msg.sender,
            nftContract: _nftContract,
            tokenId: _tokenId,
            startPrice: _startPrice,
            endTimestamp: block.timestamp + _duration,
            highestBid: _startPrice,
            highestBidder: address(0),
            highestBidCurrency: _startPriceCurrency,
            erc20TokenAddress: _erc20TokenAddress,
            highestBidInUsd: _convertToUsd(_erc20TokenAddress, _startPrice, _startPriceCurrency),
            ended: false
        });

        emit AuctionCreated(newAuctionId, msg.sender, address(_nftContract), _tokenId, _startPrice, block.timestamp + _duration);
    }

    function placeBid(uint256 _auctionId) public payable virtual {
        AuctionItem storage auction = auctions[_auctionId];
        require(auction.auctionId != 0, "Auction does not exist");
        require(!auction.ended, "Auction has ended");
        require(block.timestamp < auction.endTimestamp, "Auction has ended");

        uint256 bidInUsd = _convertToUsd(address(0), msg.value, 0); // Convert ETH bid to USD
        require(bidInUsd > auction.highestBidInUsd, "Bid must be higher than current highest bid in USD");

        // Refund previous highest bidder if any
        if (auction.highestBidder != address(0)) {
            if (auction.highestBidCurrency == 0) { // ETH
                payable(auction.highestBidder).transfer(auction.highestBid);
            } else { // ERC20
                IERC20(auction.erc20TokenAddress).transfer(auction.highestBidder, auction.highestBid);
            }
        }

        auction.highestBid = msg.value;
        auction.highestBidder = msg.sender;
        auction.highestBidCurrency = 0; // ETH
        auction.erc20TokenAddress = address(0);
        auction.highestBidInUsd = bidInUsd;

        emit BidPlaced(_auctionId, msg.sender, msg.value);
    }

    function placeBidERC20(uint256 _auctionId, uint256 _amount, address _erc20TokenAddress) public virtual {
        AuctionItem storage auction = auctions[_auctionId];
        require(auction.auctionId != 0, "Auction does not exist");
        require(!auction.ended, "Auction has ended");
        require(block.timestamp < auction.endTimestamp, "Auction has ended");
        require(_erc20TokenAddress != address(0), "ERC20 token address cannot be zero");

        uint256 bidInUsd = _convertToUsd(_erc20TokenAddress, _amount, 1); // Convert ERC20 bid to USD
        require(bidInUsd > auction.highestBidInUsd, "Bid must be higher than current highest bid in USD");

        // Transfer ERC20 from bidder to auction contract
        IERC20(_erc20TokenAddress).transferFrom(msg.sender, address(this), _amount);

        // Refund previous highest bidder if any
        if (auction.highestBidder != address(0)) {
            if (auction.highestBidCurrency == 0) { // ETH
                payable(auction.highestBidder).transfer(auction.highestBid);
            } else { // ERC20
                IERC20(auction.erc20TokenAddress).transfer(auction.highestBidder, auction.highestBid);
            }
        }

        auction.highestBid = _amount;
        auction.highestBidder = msg.sender;
        auction.highestBidCurrency = 1; // ERC20
        auction.erc20TokenAddress = _erc20TokenAddress;
        auction.highestBidInUsd = bidInUsd;

        emit BidPlaced(_auctionId, msg.sender, _amount);
    }

    function endAuction(uint256 _auctionId) public virtual {
        AuctionItem storage auction = auctions[_auctionId];
        require(auction.auctionId != 0, "Auction does not exist");
        require(!auction.ended, "Auction has ended");
        require(block.timestamp >= auction.endTimestamp, "Auction has not ended yet");

        auction.ended = true;

        if (auction.highestBidder != address(0)) {
            // Transfer NFT to the highest bidder
            auction.nftContract.transferFrom(address(this), auction.highestBidder, auction.tokenId);
            // Transfer funds to the seller
            if (auction.highestBidCurrency == 0) { // ETH
                payable(auction.seller).transfer(auction.highestBid);
            } else { // ERC20
                IERC20(auction.erc20TokenAddress).transfer(auction.seller, auction.highestBid);
            }
        } else {
            // No bids, return NFT to seller
            auction.nftContract.transferFrom(address(this), auction.seller, auction.tokenId);
        }

        emit AuctionEnded(_auctionId, auction.highestBidder, auction.highestBid);
    }

    function _convertToUsd(address _tokenAddress, uint256 _amount, uint8 _currency) internal view virtual returns (uint256) {
        AggregatorV3Interface priceFeed;
        if (_currency == 0) { // ETH
            priceFeed = ethUsdPriceFeed;
        } else { // ERC20
            priceFeed = priceFeeds[_tokenAddress];
        }

        require(address(priceFeed) != address(0), "Price feed not available");

        (, int256 price, , ,) = priceFeed.latestRoundData();
        require(price > 0, "Price feed returned invalid value");

        // Assuming price feed returns 8 decimals, and token amount is 18 decimals
        // This might need adjustment based on actual token decimals
        return (_amount * uint256(price)) / (10 ** 8);
    }
}

contracts/AuctionUpgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./Auction.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract AuctionUpgradeable is Initializable, UUPSUpgradeable, OwnableUpgradeable, Auction {
    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(
        address owner
    ) initializer public {
        __Ownable_init(owner);
        __UUPSUpgradeable_init();
        super.initialize();
        // Initialize Auction specific state here if needed
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

